A empresa Heltur Transportes e Turismo é uma empresa  pioneira no Turismo de Base Comunitária -TBC.

A Heltur, com sede em Camaçari- Bahia- Brasil, desenvolveu o  projeto Cidade Inteligente, Turismo Inteligente - CITI Tour Rural que visa construir condições práticas de mobilidade entre o urbano e o rural, disponibilizando transporte de passageiros, em veículo tipo van executiva, capacidade de até 20 lugares.

Para tanto, vai utilizar a tecnologia de um Aplicativo de mobilidade, o CITI tour rural, para estruturar rotas fixas que vão conectar unidades produtivas da agricultura familiar que praticam a agroecologia às atividades Turísticas de Base Comunitária, fomentando a economia e promovendo um turismo responsável  no Estado da Bahia- Brasil e agregando valor na prestação de serviços.

Com a mais nova ferramenta tecnológica da empresa, o app, o CITI tour rural, o viajante pode agendar sua viagem na segurança e conforto do seu lar.

O CITI tour rural, para estruturar rotas fixas que vão conectar unidades produtivas da agricultura familiar que praticam a agroecologia às atividades Turísticas de Base Comunitária, fomentando a economia e promovendo um turismo responsável  no Estado da Bahia- Brasil e agregando valor na prestação de serviços.

