- Roteiros turísticos rurais nos territórios de Identidade da Bahia (divisão político geográfica); 

- Mapa exibindo o roteiro com localização Georreferenciada;

- Tipo de transporte que irá proporcionar a mobilidade entre o urbano e o rural. Vai oferecer informações sobre a capacidade dos veículos, informar a marca, o modelo, a placa e informações do condutor do veículo;

